  <div class="centered">Centered</div>

            {/* <p style={{ textAlign:"center", marginTop: 70, }}>
              <Link to="/">Go to Home </Link>
            </p> */}
            <img src={PageNotFound}  style={{maxWidth:'100%', minWidth:'100%'}}/>


          </div>;
    }
}
